import React from 'react';
import '../styles/About.css';

const About = () => {
  return (
    <section id="about">
      <h2>About Me</h2>
      <p>
        I'm a highly skilled and versatile developer with a passion for building innovative solutions. With extensive experience across multiple technologies and platforms, I bring a comprehensive approach to software development and system engineering.
      </p>

      <h3>My Expertise</h3>
      <ul>
        <li><strong>Front-End Technologies:</strong> JavaScript, React, HTML, CSS</li>
        <li><strong>Back-End Technologies:</strong> Java, Node.js, Spring Boot, Python</li>
        <li><strong>DevOps & Cloud Computing:</strong> AWS, Docker, CI/CD pipelines, containerization</li>
        <li><strong>Scripting & Automation:</strong> Bash scripting, automation, development workflows</li>
        <li><strong>Security:</strong> Kali Linux, cybersecurity principles, practices</li>
      </ul>

      <p>
        I'm committed to delivering high-quality solutions that meet the needs of my clients. With a strong foundation in technical skills and a passion for innovation, I'm always looking for ways to improve and expand my expertise.
      </p>
    </section>
  );
};

export default About;
